import React from 'react'
import "./Panel.css";
import dra from "../../Image/dra.png";


const Panel = () => {
    return ( 
        <div className="container">
            <div className="row justify-content-center">
                <div className="col-lg-10 panel">
                    <div className="row">
                        <div className="col-lg">
                            <img src={dra} alt=""/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
     );
}

export default Panel;
